import React from "react";
import "../styles/Stories.css";
import Story from "./Story";

const Stories = () => {
  return (
    <div className="stories">
      <Story
        image="https://pbs.twimg.com/profile_images/1163489433506762752/cOHwzLom_400x400.jpg"
        name="Ada Özyeşilova"
      />
      <Story
        image="https://yt3.ggpht.com/ytc/AAUvwnhK7Z8KAunniLRpuZtDPgpp5tLHuzMdQZyAlQVz=s900-c-k-c0x00ffffff-no-rj"
        name="Tugce Nur Batmaz"
      />

      <Story
        image="https://pbs.twimg.com/profile_images/1163489433506762752/cOHwzLom_400x400.jpg"
        name="İbrahim Özyeşilova"
      />
      <Story
        image="https://scontent.fadb2-2.fna.fbcdn.net/v/t31.0-8/469038_116376928497241_1423745394_o.jpg?_nc_cat=105&ccb=1-3&_nc_sid=174925&_nc_ohc=HSGH4HHxkrEAX997_nk&_nc_ht=scontent.fadb2-2.fna&oh=5cac5e56060435afc974e0e5beba9e60&oe=607FBB21"
        name="Dilek Özyeşilova"
      />

      {/*Story*/}
      {/*Story*/}
    </div>
  );
}

export default Stories;
